import React from 'react';
import SearchBox from './SearchBox/SearchBox'
import IkeaImage from './IkeaImage/IkeaImage'

import {Container} from '@material-ui/core'

function App() {
  return (
    <Container maxWidth='lg'>
      <SearchBox />
      <IkeaImage />
    </Container>
  );
}

export default App;
